import axios from "axios";
import React, { useEffect, useState } from "react";
import { AuthContext } from "src/helper/AuthContext";

import * as S from "./styled";

export const Navbar: React.FC = () => {
  const [authState, setAuthState] = useState(false);

  const Token = async (TokenDto: any) => {
    const res = await axios.get("http://localhost:8000/auth/auth", TokenDto, {
      headers: {
        accessToken: localStorage.getItem("accessToken"),
      },
    });
  };
  return (
    <>
      <S.NavbarContainer>
        <S.NavbarFormGroup>
          <AuthContext.Provider value={{ authState, setAuthState }}>
            {!authState && (
              <>
                <S.NavbarA to="/">로그인</S.NavbarA>
                <S.NavbarA to="auth/register">회원가입</S.NavbarA>
              </>
            )}
          </AuthContext.Provider>
        </S.NavbarFormGroup>
      </S.NavbarContainer>
    </>
  );
};
